  gsl_spline_init( spline, etalist, a5list, qdim );
  gsl_interp_accel_reset( acc );
  coeffs->a5 = gsl_spline_eval( spline, eta, acc );
  gsl_spline_init( spline, etalist, b3list, qdim );
  gsl_interp_accel_reset( acc );
